  { :id => 37, :sku => "28501", :title => "6004", :description => "Bottines à lacets Doc Martens pour fille.\nPremière cuir, intérieur doublé cuir. Voici la célèbre Doc Martens déclinée pour les plus jeunes. Une version vernis qui apportera une touche tendrement rock'n roll aux petites filles. La couleur flashy apporte un style à part, non seulement à la bottine, mais également à la tenue de votre petite fille : mettez un peu de gaieté cet hiver ! Avec leur semelle épaisse et leur cuir vernis, ces bottines permettront à votre fille d'avoir les pieds bien au chaud tout l'hiver !", :created_at => "2010-08-10 10:34:27", :updated_at => "2010-08-10 10:34:27" },
  { :id => 38, :sku => "29004", :title => "ROCKER", :description => "<p>\r\n\tBottines à lacets &quot;ROCKER&quot; de Pataugas pour fille. Première cuir, intérieur doublé cuir, bout de la chaussure renforcé. Pataugas a su se mettre au goût du jour. Proposant un mix entre une chaussure outdoor et une bottine urbaine, elle n'oublie pas pour autant de prendre bien soin des pieds des petits bouts. Ultra confortables, ces bottines sont également très jolies. La semelle souple remonte à l'avant et à l'arrière. Un zip intérieur a été prévu pour plus de praticité. Et Pataugas n'oublie pas sa signature : un écusson qui atteste qu'il s'agit bien là des vraies Pataugas ! Il n'y a pas à dire, Pataugas a tout compris à l'expression &quot;être bien dans ses baskets&quot; !</p>\r\n", :created_at => "2010-08-10 10:34:28", :updated_at => "2011-01-12 10:02:12" },
  { :id => 39, :sku => "32028", :title => "4295", :description => "<p>\r\n\tBottines à fermeture éclair de Romagnoli pour fille. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, bout de la chaussure renforcé. C'est une bottine que les petites vont s'arracher pour l'hiver ! Elles apprécieront le cuir à fleurs et à pois ainsi que les lacets qui habillent la chaussure, et les mamans sauront les pieds de leur petite princesse bien au chaud !</p>\r\n", :created_at => "2010-08-10 10:34:28", :updated_at => "2011-06-22 10:52:53" },
  { :id => 40, :sku => "32083", :title => "FLORELLE", :description => "Voici la bottine \"FLORELLE\" de Babybotte spécialement conçue pour les premiers pas de votre petite fille. \nPremière cuir, intérieur doublé cuir, la chaussure possède un col matelassé pour un plus grand confort et une semelle souple pour plus de légèreté. La bottine est très travaillée : de petites perforations sur le devant et le côté de la chaussure, un cuir vernis qui se marie à un cuir marron tacheté et une jolie succession de fleurs autour de la cheville. En somme, les bottines idéales pour apporter un petit côté \"girly\" à votre petite fille adorée !", :created_at => "2010-08-10 10:34:28", :updated_at => "2010-08-10 10:34:28" },
  { :id => 41, :sku => "32084", :title => "ARTISTE F H10", :description => "<p>\r\n\tBottines à lacets “ARTISTE” de Babybotte pour fille. Première cuir, intérieur doublé cuir, bout de la chaussure renforcé. Babybotte nous propose une bottine très flashy et très travaillée. En cuir vernis légèrement métallisé, la chaussure est décorée de bandes de velours. Le revers est proposé en velours côtelé ou en tissu selon le modèle, mais toujours à motifs. Elle est aussi très confortable et maintient bien la cheville. Rien à redire, si ce n'est peut-être qu'on aimerait bien, nous aussi, pouvoir les porter ! Mais pas possible de les chiper à votre petite fille adorée...</p>\r\n", :created_at => "2010-08-10 10:34:29", :updated_at => "2011-06-22 11:09:38" },
  { :id => 42, :sku => "32086", :title => "ACTEUR F H10", :description => "<p>\r\n\tBottines à scratch “ACTEUR” de Babybotte pour fille. Première cuir, intérieur doublé cuir, bout de la chaussure renforcé. Babybotte nous propose une bottine très flashy et très travaillée. En cuir vernis légèrement métallisé, Babybotte alterne les couleurs et les matières pour donner plus de relief à la chaussure. Le revers est proposé en velours côtelé ou en tissu selon le modèle, mais toujours à motifs. Elle est aussi très confortable et maintient bien la cheville. Des bottines dans lesquelles votre petite fille se sentira comme dans des pantoufles !</p>\r\n", :created_at => "2010-08-10 10:34:29", :updated_at => "2011-06-22 11:09:39" },
  { :id => 43, :sku => "32103", :title => "GAZOUILLI", :description => "<p>\r\n\tVoilà une superbe bottine à lacets pour les premiers pas de votre petite fille : la &quot;GAZOUILLI&quot; de Little Mary ! Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, semelle souple pour de meilleures sensations, chaussant fin. La petite &quot;Mary&quot; s'est amusée pour cette bottine ! Mélange de cuirs, découpes très travaillées et petites fleurs donnent un style poétique à la chaussure. Il est facile de reconnaître toute la délicatesse de Little Mary à travers ces bottines. Votre petite princesse ne voudra plus les quitter !</p>\r\n", :created_at => "2010-08-10 10:34:30", :updated_at => "2011-01-12 10:02:22" },
  { :id => 44, :sku => "32105", :title => "GINNA", :description => "<p>\r\n\tOn craque sur les bottines à lacets &quot;GINNA&quot; de Little Mary, parfaites pour les premiers pas de votre petite fille. Première cuir, intérieur doublé cuir, col matelassé pour un bon maintien, semelle souple et personnalisée pour que la petite garde toutes les sensations, chaussant fin. Le cuir vieilli est agrémenté de fleurs en cuir métallisé et de surpiqûres. Aucune détail n'a été oublié puisque le cuir à motif sur le col matelassé reprend celui utilisé pour les fleurs. Le résultat est une bottine très actuelle, qui a toutes les chances de plaire à maman !</p>\r\n", :created_at => "2010-08-10 10:34:30", :updated_at => "2011-06-22 10:53:01" },
  { :id => 45, :sku => "32106", :title => "GERTRUDE", :description => "<p>\r\n\tVoilà les bottines à lacets &quot;GERTRUDE&quot; de Little Mary pour les premiers pas de votre petite fille ! Première cuir, intérieur doublé cuir, col matelassé pour un bon maintien, semelle souple pour un meilleur équilibre, chaussant fin. Inspiration &quot;balade&quot; pour ces petites bottines ! Il suffit de suivre la petite surpiqûre et de flâner entre les fleurs et les cœurs pour être bercée par la douceur de Little Mary. Et elle colle si bien à la douceur de votre petite princesse !</p>\r\n", :created_at => "2010-08-10 10:34:30", :updated_at => "2011-01-12 10:05:44" },
  { :id => 46, :sku => "32107", :title => "GEMMA", :description => "<p>\r\n\tElle gambade la petite avec ses bottines à lacets &quot;GEMMA&quot; de Little Mary ! Première cuir, intérieur doublé cuir, col matelassé pour plus de confort, semelle souple pour un meilleur équilibre, chaussant fin. Cette bottine est idéale pour les premiers pas de votre petite fille ! Elle tente enfin de se mettre debout dans le parc : elle a besoin d'une chaussure de qualité qui va lui permettre de ressentir toutes les sensations. Pour le faire avec style, Little Mary a décoré sa bottine de fleurs découpées et d'un petit rivet qui termine la chaussure. Avec ça, aucun doute, votre princesse va parcourir le monde !</p>\r\n", :created_at => "2010-08-10 10:34:30", :updated_at => "2011-06-22 10:12:13" },
  { :id => 47, :sku => "28280", :title => "Semelle cuir", :description => "<p>\n\tSemelle en cuir luxe.<br />\n\tCuir pleine fleur sur latex perfor&eacute; de charbon. Garantit un grand confort. Filtre les odeurs et am&eacute;liore le confort de la marche.</p>\n", :created_at => "2010-09-20 09:29:26", :updated_at => "2010-09-20 09:29:26" },
  { :id => 48, :sku => "28426", :title => "Semelle Aloe Vera Soft", :description => "<p>\n\tSemelles souples trait&eacute;es &agrave; l&#39;aloe vera. L&#39;extrait v&eacute;g&eacute;tal absorbe l&#39;humidit&eacute; et soigne vos pieds &agrave; chaque pas. La surface en microfibres offre un confort de marche doux et bienfaisant.</p>\n", :created_at => "2010-09-20 09:37:05", :updated_at => "2010-09-20 09:37:05" },
  { :id => 49, :sku => "282920101000", :title => "Brosse à reluire", :description => "<p>\n\tBrosse &agrave; reluire Collonil. Cette brosse &agrave; reluire vous permettra de nettoyer vos chaussures en cuir lisse et de les faire briller apr&egrave;s le cirage.</p>\n", :created_at => "2010-09-20 09:39:59", :updated_at => "2010-10-01 13:54:46" },
  { :id => 50, :sku => "28276", :title => "Crème de cirage", :description => "<p>\n\tSupr&ecirc;me Cr&egrave;me de Luxe.<br />\n\tCr&egrave;me de cirage qui contient des huiles et cires naturelles de haute qualit&eacute; qui prot&egrave;gent et contribuent au bien &ecirc;tre des cuirs lisses, bross&eacute;s et brillants. Ravive les couleurs et conf&egrave;re au cuir un brillant profond et parfait, un superbe toucher et une odeur doucement parfum&eacute;e.</p>\n", :created_at => "2010-09-20 09:44:06", :updated_at => "2010-09-20 09:44:06" },
  { :id => 51, :sku => "282750101000", :title => "Lotion pour cuir", :description => "<p>\r\n\tCette lotion est très riche en Aloe Vera et en huiles de haute qualité. Elle entretient et régénère les cuirs les plus fins. Elle protège le cuir en lui conservant son humidité naturelle et le laisse souple et doux. A utiliser sur les chaussures, vêtements et maroquineries.</p>\r\n", :created_at => "2010-10-12 09:34:35", :updated_at => "2010-10-12 09:34:35" },
  { :id => 52, :sku => "282770101000", :title => "Lait pour vernis", :description => "<p>\r\n\tClassic Lack Polish.<br />\r\n\tLait pour vernis et combinaison de cuirs lisses ou grainés. Évite au vernis de craqueler, conserve l'aspect brillant et ravive les couleurs.</p>\r\n", :created_at => "2010-10-12 09:36:14", :updated_at => "2010-10-12 09:36:14" },
  { :id => 53, :sku => "282910101000", :title => "Gomme à daim", :description => "<p>\r\n\tGomme à daim Collonil à utiliser sur tous les articles en daim et nubuck : chaussures, vêtements, maroquinerie. Cette gomme détachante est conçue pour le nettoyage à sec. Elle élimine les salissures et redonne au cuir son aspect initial. Conseil d'utilisation : frottez délicatement puis brossez.</p>\r\n", :created_at => "2010-10-12 09:37:30", :updated_at => "2010-10-12 09:37:30" },
  { :id => 54, :sku => "282900101000", :title => "Brosse en crêpe", :description => "<p>\r\n\tBrosse pour chaussures en daim et nubuck. Elle vous permettra de nettoyer vos chaussures au quotidien sans les abîmer.</p>\r\n", :created_at => "2010-10-12 09:38:46", :updated_at => "2010-10-12 09:38:46" },
  { :id => 55, :sku => "282720101000", :title => "Imperméabilisant toutes matières", :description => "<p>\r\n\tSuprem Protect Spray.<br />\r\n\tImperméabilise vos chaussures quelle qu'en soit la matière (cuir, velours, tissus, vernis...). Les protège de l'eau, de l'humidité et des salissures. Ravive les couleurs.<br />\r\n\tSupport : toutes matières, chaussures, maroquinerie, vêtements.</p>\r\n", :created_at => "2010-10-12 09:39:56", :updated_at => "2010-10-12 09:39:56" },
  { :id => 56, :sku => "282740101000", :title => "Crème pour cuir incolore", :description => "<p>\r\n\tCette crème contient des huiles de très haute qualité pour l'entretien, ainsi que des substances nourrissantes qui permettent un entretien du cuir satisfaisant les plus hautes exigences. Cette crème au pouvoir nettoyant très doux redonne un brillant éclatant au cuir et lui confère un toucher exceptionnel.</p>\r\n", :created_at => "2010-10-12 09:42:03", :updated_at => "2010-10-12 09:42:03" },
  { :id => 57, :sku => "282730101000", :title => "Imperméabilisant et nourissant pour cuir", :description => "<p>\r\n\tSuprem Wax Spray.<br />\r\n\tSpray d'entretien et imperméabilisant de luxe. Des huiles et cires de haute qualité protègent et entretiennent les cuirs fins et grainés ainsi que les cuirs brossés, les nappas et les cuirs antiques.</p>\r\n", :created_at => "2010-10-12 09:43:20", :updated_at => "2010-10-12 09:43:20" },
  { :id => 58, :sku => "34025", :title => "JUNGLE POM VELCRO", :description => "<p>\r\n\tVotre petite puce comment à se mettre debout ? Pensez à la chausser de ces nu-pieds en cuir &quot;JUNGLE POM VELCRO&quot; de Pom d'Api ! Première cuir, intérieur doublé cuir, col matelassé pour plus de confort, semelle souple pour un bon équilibre. Comment ne pas craquer devant ces petites merveilles ? Un joli rose, deux petites pommes en décor, une découpe originale... Avec ces nu-pieds Pom d'Api aux pieds, votre princesse sera à croquer ! Deux bandes velcro permettent de bien régler la chaussure et de l'enfiler facilement. Des nu-pieds vraiment parfaits pour la saison chaude !</p>\r\n", :created_at => "2011-03-23 08:44:37", :updated_at => "2011-06-22 10:48:49" },
  { :id => 59, :sku => "34033", :title => "LILY ROPE GUETRE", :description => "<p>\r\n\tNu-pieds en cuir &quot;LILY ROPE GUETRE&quot; de Pom d'Api pour fille. Première cuir, intérieur doublé cuir. Pom d'Api sait toujours ce qui plait aux jeunes filles : des modèles à la fois tendances et pratiques. Ici, Pom d'Api a opté pour un décor à base de rivets et de clous. La cheville quant à elle est mise en valeur par une pièce de tissu disposée à la manière d'une guêtre. La semelle est enrobée d'une fine corde tressée. Une bande Velcro a été prévue sur le côté intérieur pour les enfiler facilement et rapidement. Rien a redire, si ce n'est que ce modèle est furieusement tendance !</p>\r\n", :created_at => "2011-03-23 08:51:03", :updated_at => "2011-06-22 10:48:48" },
  { :id => 60, :sku => "34026", :title => "JUNGLE EXPLO", :description => "<p>\r\n\tVotre petit bonhomme commence à se mettre debout ? Pensez à le chausser de ces nu-pieds en cuir &quot;JUNGLE EXPLO&quot; de Pom d'Api ! Première cuir, intérieur doublé cuir, col matelassé pour plus de confort, semelle souple pour un bon équilibre. Respectant parfaitement la croissance des pieds fragiles, ces nu-pieds signés Pom d'Api sont parfaits pour les beaux jours. Bien ouverts, ils laisseront respirer les pieds de votre bout de chou tout en les protégeant. Deux bandes Velcro permettent de régler correctement la chaussure. Et le petit détail qui change tout : les deux petites pommes qui viennent décorer les brides !</p>\r\n", :created_at => "2011-03-23 09:01:35", :updated_at => "2011-06-10 12:02:54" },
  { :id => 61, :sku => "34340", :title => "112950", :description => "<p>\r\n\tNu-pieds en cuir Agatha Ruiz de la Prada pour fille.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour plus de confort.<br />\r\n\tVoilà une chaussure qui sent vraiment le plein été ! Agatha Ruiz s'amuse ici avec les couleurs et les dessins. Du rose, du blanc, du vert, du orange, du mauve : autant de couleurs vives qui mettent de la gaité aux pieds ! Pleine d'amour, la marque le crie sur tous les pieds, et surtout ceux de votre petite fille : LOVE ! Le message semble clair. Comment ne pas la trouver craquante avec ces petites chaussures aux pieds ?</p>\r\n", :created_at => "2011-06-10 11:57:08", :updated_at => "2011-06-10 12:23:52" },
  { :id => 62, :sku => "36679", :title => "LOLLY POP", :description => "<p>\r\n\tBottes en caoutchouc &quot;LOLLY POP&quot; de Aigle pour enfant.<br />\r\n\tL'eau qui mouille ne sera plus qu'un mauvais souvenir grâce à ces bottes signées Aigle ! Vous retrouvez la simplicité signée Aigle avec la grande qualité de chaussures. En plus, la marque a pensé aux bouts de chou et propose son modèle en trois coloris dont un jaune flashy !</p>\r\n", :created_at => "2011-06-10 12:23:37", :updated_at => "2011-06-10 12:27:39" },
  { :id => 63, :sku => "34227", :title => "A402 BIO CITY", :description => "<p>\r\n\tNu-pieds &quot;A402 BIO CITY&quot; de Art pour fille.<br />\r\n\tPremière cuir, intérieur doublé cuir.<br />\r\n\tToujours créative, la marque Art nous inonde de bonne humeur avec ses chaussures. Elle propose ici un nu-pieds amusant pour les jeunes filles : en version jeans ou en version blanc, il s'habille de surpiqûres coloré. Sa semelle est colorée : Art ne manque pas à sa réputation ! Une bride Velcro sur le dessous permet d'adapter légèrement la taille. Au final, ce modèle mettra tout le monde d'accord !</p>\r\n", :created_at => "2011-06-10 12:30:44", :updated_at => "2011-06-10 12:32:13" },
  { :id => 64, :sku => "34224", :title => "A503 DOVER", :description => "<p>\r\n\tChaussures basses &quot;DOVER&quot; de Art pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir.<br />\r\n\tArt va faire fureur auprès des bonhommes cet été ! Une forme simple rehaussée par de jolies couleurs vives et de subtils détails : voilà le secret pour mettre une bonne dose de gaité aux pieds des jeunes garçons ! Habillées de jeans ou de toile rouge, ces chaussure sont décorées de surpiqûres jaunes. Art mélange les couleurs pour le cuir et termine le tout par son célèbre &quot;a&quot; bien reconnaissable. Deux brides Velcro permettent de bien régler la chaussure et de l'enfiler rapidement. Des chaussures qui font la différence !</p>\r\n", :created_at => "2011-06-10 12:33:22", :updated_at => "2011-06-10 12:35:12" },
  { :id => 65, :sku => "34006", :title => "TILO E11", :description => "<p>\r\n\tBottines en cuir &quot;TILO&quot; de Aster pour garçon.</p>\r\n<p>\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour un meilleur confort. Allures tout terrain pour ces petites bottines ! Parfaites pour les enfants qui ne tiennent pas en place, elles sont particulièrement confortables. La semelle crantée est recouvrante à l'avant et à l'arrière. Et comme l'écrit Aster, elle est anti-choc et anti-torsion ! La tige descend légèrement vers l'arrière pour ne pas blesser les petites chevilles fragiles. Les surpiqûres viennent mettre en relief les différentes pièces de cuir. Les lacets permettent de régler correctement la bottine. Voilà des chaussures parfaites pour les vrais petits hommes !</p>\r\n", :created_at => "2011-06-10 12:56:36", :updated_at => "2011-06-22 10:48:48" },
  { :id => 66, :sku => "34117", :title => "20041 ALL", :description => "<p>\r\n\tBottines en cuir Banaline pour fille. Première cuir intérieur doublé cuir. Banaline propose ici une petite bottine fermée qui maintiendra parfaitement le pied. Mais la marque pense également au look de votre petite princesse : elle habille ces bottines d'un joli cuir rose, agrémenté d'une fleur colorée sur le côté. Les lacets blancs viennent illuminer la bottine. La semelle épaisse quant à elle lui apporte un petit côté sportif qui suit à merveille avec le reste. Parfaite niveau look, confortable pour les pieds fragiles, votre petite puce sera parfaitement chaussée avec ces bottines Banaline !</p>\r\n<p>\r\n\tNous vous conseillons de prendre une pointure au-dessus de la pointure habituelle de votre enfant.</p>\r\n", :created_at => "2011-06-10 13:04:54", :updated_at => "2011-06-10 13:06:14" },
  { :id => 67, :sku => "34116", :title => "12210 ALL", :description => "<p>\r\n\tBaskets en cuir Banaline pour enfant.</p>\r\n<p>\r\n\tPremière cuir, intérieur doublé cuir. Ultra tendances, ces baskets plairont à tous les jeunes. Complètement dans l'air du temps, ces sneakers au look rétro s'habillent d'un mélange de cuir et de toile. Les carreaux renforcent le côté vintage. Le col montant nous fait voyager dans le temps et nous ramène quelques années en arrière. Le bleu électrique termine parfaitement ces baskets Banaline. Avec ces chaussures aux pieds, votre enfant va sans conteste devenir le plus cool de l'école !</p>\r\n", :created_at => "2011-06-10 13:07:27", :updated_at => "2011-06-10 13:07:27" },
  { :id => 68, :sku => "32297", :title => "TIMOUSS", :description => "<p>\r\n\tBottes en caoutchouc &quot;TIMOUSS&quot; de Be Only. Pour que les enfants ne se mouillent pas les pieds, pensez aux bottes en caoutchouc ! Terminée cette période où ces dernières étaient ringardes : aujourd'hui la mode décline les bottes en caoutchouc au quotidien. Proposées ici en version rayée, bleue ou jaune, ces bottes garderont les pieds des enfants bien au sec, pour passer toute la journée parfaitement chaussé !</p>\r\n", :created_at => "2011-06-10 13:11:26", :updated_at => "2011-06-10 13:11:26" },
  { :id => 69, :sku => "35246", :title => "CHAUSSONS LIZ ET LEO", :description => "<p>\r\n\tChaussons édition spéciale “LIZ&amp;LEO” de Bellamy pour bébé.</p>\r\n<p>\r\n\tLa pointure 17 correspond à du 0-6 mois.</p>\r\n<p>\r\n\tPremière cuir, intérieur doublé cuir, semelle souple, col légèrement élastique. A l'occasion de la naissance des jumeaux Liz&amp;Leo, le site propose des chaussons Bellamy griffés en édition limitée ! Adorable avec les deux petites têtes de Liz et de Leo, ces chaussons protégeront parfaitement les pieds de bébé sans gêner leur croissance. Ils sont parfaits pour un cadeau de naissance, pour offrir ou pour vous faire plaisir ! En plus, les chaussons Bellamy sont respectueux du pied de Bébé mais également sains pour sa santé. Les cuirs sont garantis sans traitement au chrome. Ils sont entièrement cousus, sans utilisation de colle. Ils sont également lavables et 100 % recyclables.</p>\r\n", :created_at => "2011-06-10 13:20:35", :updated_at => "2011-06-10 13:20:35" },
  { :id => 70, :sku => "34983", :title => "GIZEH ENF E11", :description => "<p>\r\n\tNu-pieds &quot;GIZEH&quot; de Birkenstock pour fille.<br />\r\n\tPremière cuir.<br />\r\n\tLes célèbres sandales reviennent cet été pour le plus grand plaisir des enfants. Ultra confortables avec leur semelle anatomique, elles sont également tendances et amusantes avec leur sangle bien reconnaissable. Proposées ici en version colorée ou argentée, elles se dotent d'une bride cou-de-pied qui permet de bien régler la chaussure. Voici LES chaussures à adopter pour l'été !</p>\r\n<p>\r\n\tSi vous hésitez entre deux pointures pour votre enfant, nous vous conseillons de prendre la pointure inférieure.</p>\r\n", :created_at => "2011-06-10 14:35:04", :updated_at => "2011-06-22 10:57:18" },
  { :id => 71, :sku => "34985", :title => "ELLICE", :description => "<p>\r\n\tNu-pieds &quot;ELLICE&quot; de Birkenstock pour garçon.<br />\r\n\tPremière cuir.<br />\r\n\tLes célèbres sandales reviennent cet été pour le plus grand plaisir des enfants. Ultra confortables avec leur semelle anatomique, elles sont également tendances et amusantes avec leur sangle bien reconnaissable. Proposées ici en version sobre pour les bonhommes, elles se dotent de quatre brides qui permettent de bien régler la chaussure. Voici LES chaussures à adopter pour l'été !</p>\r\n<p>\r\n\tSi vous hésitez entre deux pointures pour votre enfant, nous vous conseillons de prendre la pointure inférieure.</p>\r\n", :created_at => "2011-06-10 14:58:10", :updated_at => "2011-06-10 15:01:53" },
  { :id => 72, :sku => "33683", :title => "80084", :description => "<p>\r\n\tChaussures en cuir Camper pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour plus de confort. Adorables, ces petites chaussures seront particulièrement confortables. Leur look créatif est parfaitement représentatif de l'esprit Camper. Trois bandes Velcro permettent de régler correctement la chaussure. Une multitude de perforations vient habiller le bout de la chaussure. Une bande de caoutchouc a été ajoutée au niveau de la semelle. Un modèle qui plaira à tous les bonhommes !</p>\r\n<p>\r\n\tNous vous conseillons de prendre une pointure en-dessous de la pointure habituelle de votre enfant.</p>\r\n", :created_at => "2011-06-10 15:03:28", :updated_at => "2011-06-10 15:16:06" },
  { :id => 73, :sku => "33681", :title => "80269", :description => "<p>\r\n\tNu-pieds en cuir Camper pour fille. Première cuir, intérieur doublé cuir, col matelassé pour plus de confort. Voilà des petites chaussures parfaites pour l’été ! Camper met de la couleur et de la fantaisie dans la vie des fillettes. Avec la jolie couleur verte à l’intérieur et sur la semelle, la chaussure prend tout de suite beaucoup d’allure. Et pour faire craquer les jeunes filles, Camper ajoute une belle plante grimpante en cuir sur le dessus. Deux brides Velcro permettent de régler correctement la chaussure. Foncez sans hésiter !</p>\r\n<p>\r\n\tNous vous conseillons de prendre une pointure en-dessous de la pointure habituelle de votre enfant.</p>\r\n", :created_at => "2011-06-10 15:16:37", :updated_at => "2011-06-10 15:17:58" },
  { :id => 74, :sku => "33815", :title => "CACILIE", :description => "<p>\r\n\tChaussures basses en cuir “CACILIE” de Catimini pour fille. Première cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chaussure renforcé. Cette chaussure est tellement colorée et gaie que l’on dirait une véritable œuvre d’art ! Catimini a tout mis en place pour séduire les fillettes. Vives, elles mettront de la bonne humeur aux pieds des jeunes princesses. Le cuir irisé, les fleurs de cuir, les bandes multicolores, les surpiqûres et les superpositions réussissent à nous emmener dans un univers féérique. Une bride Velcro permet de maintenir parfaitement le pied et de serrer la chaussure comme il faut. Avec ça, votre puce pourra rêver et jouer bien chaussée !</p>\r\n", :created_at => "2011-06-10 15:19:49", :updated_at => "2011-06-10 15:19:49" },
  { :id => 75, :sku => "33819", :title => "CADOURS", :description => "<p>\r\n\tBottines en cuir &quot;CADOURS&quot; de Catimini pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, bout de la chaussure renforcé. Catimini a pensé ici une petite bottine au look moderne. Le mélange du tissu et du cuir apporte un côté très tendance. Mais c’est bien les couleurs et l’intérieur turquoise qui viennent illuminer cette bottine ! Les écritures et le cou-de-pied estampillé “C” renforcent le style actuel de la chaussure : les petits vont pouvoir être tendances comme les grands ! Catimini a ajouté une bride Velcro qui permet de régler correctement la bottine et de l'enfiler rapidement. Et aucun détail n’a été oublié : Catimini a voulu la bottine marrante jusqu’au bout de la semelle !</p>\r\n", :created_at => "2011-06-10 15:22:09", :updated_at => "2011-06-10 15:22:09" },
  { :id => 76, :sku => "34042", :title => "VINDI", :description => "<p>\r\n\tBottines en cuir “VINDI” de Chipie pour fille.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chaussure renforcé.<br />\r\n\tAdorables, ces bottines signées Chipie ne manquent pas de fantaisie. La marque les habille d’un mélange de toile et de cuir : rayures, pois, fleurs et contours dentelés, c'est un véritable patchwork prévu pour faire craquer les fillettes ! Une bride Velcro permet un bon réglage de la chaussure. Une sangle permet un excellent maintien du pied. Un modèle qui va faire fureur !</p>\r\n", :created_at => "2011-06-10 15:25:54", :updated_at => "2011-06-10 15:27:18" },
  { :id => 77, :sku => "34114", :title => "14201", :description => "<p>\r\n\tChaussures basses en cuir CKS pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort. &quot;Attention, derrière toi !&quot;, &quot;vite, cachons-nous dans ces buissons !&quot;... C'est le quotidien de votre bonhomme ? Il lui faut les chaussures idéales pour compléter sa tenue ! En version camouflage, ce sera parfait ! Particulièrement travaillées, ces chaussures mélangent également les matières. Trois bandes Velcro ont été prévues pour bien maintenir le pied et régler la chaussure comme il faut. Un zip intérieur a cependant été prévu pour plus de praticité. Confortables, ces chaussures vont faire fureur chez les bouts de chou !</p>\r\n", :created_at => "2011-06-10 15:41:08", :updated_at => "2012-10-30 17:23:30" },
  { :id => 78, :sku => "33639", :title => "8175", :description => "<p>\r\n\tBottines à lacets Doc Martens pour fille. Première cuir, intérieur doublé cuir. Voici la célèbre Doc Martens déclinée pour les plus jeunes. Une version vernis qui apportera une touche tendrement rock'n roll aux jeunes filles. La couleur flashy apporte un style à part, non seulement à la bottine, mais également à la tenue de votre fille : mettez un peu de gaieté cet hiver ! Avec leur semelle épaisse et leur cuir vernis, ces bottines permettront à votre fille d'avoir les pieds bien au chaud tout l'hiver !</p>\r\n", :created_at => "2011-06-10 15:45:28", :updated_at => "2012-10-24 12:27:42" },
  { :id => 79, :sku => "34521", :title => "BLUBLU ONCLE", :description => "<p>\r\n\tChaussons &quot;BLUBLU ONCLE&quot; de Easy Peasy pour bébé.</p>\r\n<p>\r\n\tLa pointure 18 correspond à du 6-12 mois.<br />\r\n\tLa pointure 20 correspond à du 12-18 mois.<br />\r\n\tLa pointure 22 correspond à du 18-24 mois.</p>\r\n<p>\r\n\tChaussons entièrement cuir, semelle souple, col légèrement élastique. Savez-vous ce que signifie littéralement &quot;easy peasy&quot; ? Les anglais traduisent ça par &quot;fastoche&quot;. Parce qu'avec les chaussons Easy Peasy, c'est fastoche de ramper ou de faire son tout premier pas. La marque se veut éco friendly, c'est-à-dire respectueuse de l'environnement. Pour cela, elle emploie au maximum les matières premières et écologiques. En plus de tout ça, le look n'est pas oublié. Toujours originaux, les chaussons Easy Peasy sont aussi là pour amuser les tout-petits et les aider à s'éveiller. La preuve avec ce monstre gentil ! Et en prime, recevez une pochette toute marrante !</p>\r\n", :created_at => "2011-06-10 15:55:42", :updated_at => "2012-10-30 17:20:46" },
  { :id => 80, :sku => "34230", :title => "E120 YGG DRASIL", :description => "<p>\r\n\tSabots en cuir &quot;YGG DRASIL&quot; de El Naturalista pour fille.<br />\r\n\tPremière cuir, intérieur doublé cuir.<br />\r\n\tLes sabots reviennent en force cet été. Il n'y avait pas de raison que les jeunes filles ne puissent pas en profiter ! Ainsi, El Naturalista en propose une version adaptée aux pieds des jeunes filles. Le petit talon est compensé par l'épaisse semelle : il ne fait que donner illusion ! Une bride Velcro à l'arrière permet de bien maintenir le pied et de régler correctement la chaussure. En plus, El Naturalista utilise des matières naturelles et écologiques : la santé et la mode, que demander de plus ?</p>\r\n", :created_at => "2011-06-10 15:58:41", :updated_at => "2011-06-10 15:58:41" },
  { :id => 81, :sku => "32430", :title => "613", :description => "<p>\r\n\tBottines en cuir El Naturalista pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort. L'environnement est devenu une préoccupation internationale. Commencez par agir en mettant les pieds de votre fiston &quot;au vert&quot; ! El Naturalista est réputée pour n'utiliser que des matériaux respectueux de la nature. Et ces valeurs se retrouvent également dans l'esthétique des chaussures : couleurs naturelles, motifs issus du monde qui nous entoure... il suffit de regarder la semelle personnalisée ! Les trois bandes Velcro permettent d'enfiler la chaussure facilement. Avec ces bottines, votre écolo en herbe a de quoi être fier !</p>\r\n", :created_at => "2011-06-10 16:01:22", :updated_at => "2011-06-10 16:01:22" },
  { :id => 82, :sku => "34123", :title => "EFFIE", :description => "<p>\r\n\tNu-pieds en cuir &quot;EFFIE&quot; de Eliane et Lena pour fille. Première cuir, intérieur doublé cuir. Ravissants, ces nu-pieds en feront craquer plus d'une ! De jolis coloris doux et poudrés, un cuir très travaillé et des détails sublimés : voilà comment Eliane et Lena voit l'été ! Les sangles sont tantôt tressées, tantôt fleurie. Le cou-de-pied est habillé d'une large pièce de cuir et d'un fleur particulièrement travaillée. Une bride Velcro à l'arrière, qui se termine par un bijou argenté, permet un bon réglage de la chaussure. Dommage que la marque ne propose pas les mêmes pour les grandes !</p>\r\n", :created_at => "2011-06-10 16:03:45", :updated_at => "2011-06-10 16:03:45" },
  { :id => 83, :sku => "35994", :title => "OAK VELCRO", :description => "<p>\r\n\tBaskets en toile &quot;OAK VELCRO&quot; de Faguo pour enfant.<br />\r\n\tPremière cuir, bout de la chaussure renforcé.<br />\r\n\tVous êtes soucieux du bien-être des pieds de vos enfants ? C'est Faguo qu'il vous faut ! En effet, la marque propose des chaussures dites &quot;vertes&quot; : comprenez par là écologiques ! Le look est à la fois simple et tendance. Sur le côté, un bouton vient décorer la tennis. Disponibles en plusieurs coloris, ces baskets les feront tous craquer !</p>\r\n", :created_at => "2011-06-10 16:07:10", :updated_at => "2011-06-10 16:07:10" },
  { :id => 84, :sku => "35146", :title => "FE-LO KID", :description => "<p>\r\n\tBaskets en toile &quot;FE-LO&quot; de Feiyue pour enfant.</p>\r\n<p>\r\n\tBout de la chaussure renforcé. Feiyue, la marque tendance chez les grands, proposent sa célèbre basket aux plus jeunes. Avec ses ailes latérales de couleurs, elle mettra de la gaieté aux pieds des jeunes. La version noire possède des œillets colorés dont les enfants vont raffoler. Avec ces chaussures Feiyue aux pieds, nul doute que les jeunes seront tendances !</p>\r\n", :created_at => "2011-06-10 16:10:08", :updated_at => "2011-06-10 16:10:08" },
  { :id => 85, :sku => "34346", :title => "112604", :description => "<p>\r\n\tChaussures basses en cuir Garvalin pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chausure renforcé.<br />\r\n\tTendances, ces chaussures plairont à coup sûr aux jeunes garçons. Leur look moderne ne se retrouve nulle part ailleurs. Le mélanger des couleurs et la semelle vieilli apportent un léger côté rétro et &quot;used&quot; à la chaussure. La découpe des pièces de cuir et les surpiqûres, ainsi que la pièce de jeans finissent d'apporter le style créatif de la chaussure. Une bande Velcro permet un bon régalge de la chaussure et un excellent maintien du pied. Un modèle qui n'a pas fini de faire parler de lui !</p>\r\n", :created_at => "2011-06-10 16:13:05", :updated_at => "2011-06-10 16:13:05" },
  { :id => 86, :sku => "33853", :title => "MATHEO", :description => "<p>\r\n\tChaussures basses en cuir &quot;MATHEO&quot; de GBB pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chaussure renforcé.<br />\r\n\tUn look simple et agréable : voilà comment décrire ces chaussures signées GBB. La marque opte pour un léger côté sportif, juste ce qu'il faut pour plaire aux garçons et aux mamans. Les pièces de cuir nubuck apporte un côté classique et sage à la chaussure. Deux brides Velcro permettent de régler correctement la chaussure et de bien maintenir le pied. Un mot d'ordre : &quot;allons-y&quot;, comme c'est écrit sur la semelle !</p>\r\n", :created_at => "2011-06-10 16:16:48", :updated_at => "2011-06-22 10:48:49" },
  { :id => 87, :sku => "33996", :title => "J MARLON A", :description => "<p>\r\n\tChaussures “J MARLON” de Geox pour garçon. Col matelassé pour plus de confort, semelle recouvrante à l’avant et à l’arrière. Votre garçon vous réclame des baskets à tout bout de champ et vous avez peur pour la bonne croissance de ses petons ? Voici la solution : des chaussures Geox aux allures de baskets ! Bien adaptées aux pieds des enfants, elles bénéficient en plus de toute la technologie Geox avec les semelles respirantes : l’humidité intérieure s’évacue et celle à l’extérieur ne pénètre pas ! Deux bandes Velcro permettent de régler correctement la chaussure. Voilà une bonne raison de lui faire plaisir !</p>\r\n", :created_at => "2011-06-10 16:21:21", :updated_at => "2011-06-22 10:48:48" },
  { :id => 88, :sku => "32621", :title => "STRENGEN", :description => "<p>\r\n\tPantoufles “STRENGEN” de Giesswein pour enfant. Laine foulée et semelle en caoutchouc brevetée, anti-dérapante. Chaudes, douillettes, belles... ces pantoufles ont vraiment tout pour plaire. Dans un style simple et à la fois chic, elles ne sont pas sans rappeler les vestes en tweed agrémentées de coudières en cuir. Ici, la pièce de cuir a été placée au niveau du talon. Les tons naturels renforcent ce côté légèrement rétro. Pour ce qui est du col en laine tricotée, ils nous inspirent tout simplement de rester sous la couette, bien au chaud au coin du feu ! Vos enfants vont adorer ces pantoufles confortables à souhait et ils ne voudront plus les quitter !</p>\r\n", :created_at => "2011-06-10 16:25:28", :updated_at => "2011-06-22 10:53:42" },
  { :id => 89, :sku => "34443", :title => "QUIFF", :description => "<p>\r\n\tBaskets &quot;QUIFF&quot; de Gola pour garçon. Pour faire comme les plus grands, Gola propose une tennis en toile adaptée aux plus jeunes. Habillée de toile et de cuir velours, elle fera craquer les bonhommes comme les mamans ! Deux bandes Velcro permettent de régler correctement la chaussure et de les enfiler rapidement. Disponibles en trois coloris vous avez le choix ! Les jeunes garçons aussi aiment être tendances, et en Gola, ils auront tout bon !</p>\r\n", :created_at => "2011-06-10 16:28:01", :updated_at => "2011-06-10 16:29:49" },
  { :id => 90, :sku => "34262", :title => "4949/5", :description => "<p>\r\n\tBottines en cuir Hoops pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir, bout de la chaussure renforcé.<br />\r\n\tHoops propose un modèle qui mêle tendance, élégance et côté sportif. Les tons doux sont réveillés par des couleurs plus vives. La semelle a été légèrement vieillie pour renforcer ce côté &quot;à la mode&quot; de la bottine. Un zip intérieur a été prévu pour plus de praticité. Rien à redire, si ce n'est que ce modèle rendra votre bonhomme plus que craquant !</p>\r\n", :created_at => "2011-06-10 16:33:22", :updated_at => "2011-06-10 16:33:22" },
  { :id => 91, :sku => "34740", :title => "W23500", :description => "<p>\r\n\tBottes en caoutchouc Hunter pour enfants.</p>\r\n<p>\r\n\tLiz&amp;Leo vous offre les chaussettes Hunter !</p>\r\n<p>\r\n\tPremière cuir, intérieur doublé cuir. Pour que vos bouts de chou ne se mouillent pas les pieds cet hiver, pensez aux bottes en caoutchouc Hunter ! Adorables, vos enfants vont les adorer. Disponibles en bleu marine ou en noir, elles seront parfaites pour sauter dans les flaques ! Un jeu dont tous les petits raffolent... Les chaussettes Hunter vous sont offertes avec les bottes. Pratiques, elles permettent d'ajouter un joli revers à la botte ! Et également de les transformer en nid douillet pour le froid et le ski ! Vous les glissez dans les bottes : avec ça vos petits bouts n'auront vraiment pas froid aux pieds !</p>\r\n", :created_at => "2011-06-10 16:36:34", :updated_at => "2011-06-10 16:36:34" },
  { :id => 92, :sku => "33720", :title => "BASIC ENF", :description => "<p>\r\n\tBaskets en toile &quot;BASIC&quot; de Kawasaki pour enfant.</p>\r\n<p>\r\n\tPour faire comme les grands, Kawasaki propose sa célèbre tennis pour les plus jeunes. Vous retrouverez alors son style doucement rétro, sa semelle recouvrante à l'avant et sa bande de cuir ainsi que ses lignes arrondies. Après tout, il n'y a pas que les grands qui ont le droit d'être à la mode ! Les jeunes aussi ont droit à leur paire de Kawasaki !</p>\r\n", :created_at => "2011-06-10 16:39:30", :updated_at => "2011-06-10 16:39:30" },
  { :id => 93, :sku => "33494", :title => "MATISSE", :description => "<p>\r\n\tBottines en cuir &quot;MATISSE&quot; de Kickers pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chaussure renforcé.<br />\r\n\t&quot;Matisse&quot;, un nom bien choisi pour ces bottines au look créatif et différent ! Kickers nous en met plein les yeux avec ce modèle zébré. Les lacets permettent de régler correctement la chaussure et de bien maintenir le pied. Pour quelle couleur allez-vous craquer ? Le bleu ou le beige et vert ?</p>\r\n", :created_at => "2011-06-10 16:43:39", :updated_at => "2011-06-10 16:43:39" },
  { :id => 94, :sku => "32096", :title => "HIRO", :description => "<p>\r\n\tBottines en cuir &quot;HIRO&quot; de Le Loup Blanc pour garçon. Dédiée aux chaussures médicales, la marque a tout prévu. Les chaussures peuvent accueillir tous les types de semelles correctrices. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, bout de la chaussure renforcé. Ludique et rigolote, cette petite bottine plaira au plus grand nombre. Deux bandes Velcro ont été prévues pour plus de praticité : votre bonhomme pourra enfiler ses chaussures facilement ! Les jeux avec les pièces de cuir et les surpiqûres rendent cette bottine vraiment rigolote, comme le mélange des couleurs. Mais elle n'en est pas moins bien adaptée aux pieds de votre petit bout, bien au contraire ! Pour vous assurer du confort des pieds de votre petit cet hiver, pensez aux bottines Loup Blanc !</p>\r\n", :created_at => "2011-06-14 21:25:39", :updated_at => "2011-06-14 21:25:39" },
  { :id => 95, :sku => "33804", :title => "HEMMA", :description => "<p>\r\n\tBottines en cuir &quot;HEMMA&quot; de Loup Blanc pour fille.<br />\r\n\tDédiée aux chaussures médicales, la marque a tout prévu. Les chaussures peuvent accueillir tous les types de semelles correctrices. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, bout de la chaussure renforcé.<br />\r\n\tLoup Blanc a beau proposer des chaussures médicales, la marque n'en oublie pas pour autant d'être jolie et pleine de charme pour les enfants. La preuve ici avec ces bottines fantaisie ! Les pièces de cuir à l'avant apportent beaucoup d'originalité. La bride cheville permet un bon réglage de la chaussure. Vous avez toutes les raisons de craquer !</p>\r\n", :created_at => "2011-06-14 21:42:04", :updated_at => "2011-06-14 21:42:04" },
  { :id => 96, :sku => "32124", :title => "GALOI", :description => "<p>\r\n\tBottines à lacets &quot;GALOI&quot; de Little Mary pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort. Cette bottine est une invitation au voyage ! Coloris d'inspiration terre et mer, estampillée, cette bottine emmènera votre petit bout très loin ! Pas d'inquiétude face à tous ces kilomètres qui vont être parcourus, puisque Little Mary pense toujours ses chaussures de manière à respecter la croissance des pieds. Allez hop, on embarque !</p>\r\n", :created_at => "2011-06-14 21:48:13", :updated_at => "2011-06-22 10:12:52" },
  { :id => 97, :sku => "33565", :title => "ADENIS", :description => "<p>\r\n\tVotre petit bout se lance et commence à se mettre debout ? Pensez à le chausser des bottines en cuir &quot;ADENIS&quot; de MOD8 pour garçon.</p>\r\n<p>\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, semelle souple pour un bon équilibre, bout de la chaussure renforcé. Quand le petit commence à se mettre debout, il faut penser à bien protéger ses pieds. Ces bottines maintiendront les petons parfaitement en place, et ne gêneront en aucun cas leur bonne croissance. Et comme MOD8 pense à tout, le look a été particulièrement travaillé. Doucement sportive, cette chaussure s'inspire de celle des grands. Élégante dans ses tons doux, voilà de quoi faire comme papa !</p>\r\n", :created_at => "2011-06-14 21:54:44", :updated_at => "2011-06-14 21:54:44" },
  { :id => 98, :sku => "34945", :title => "MOON BOOT", :description => "<p>\r\n\tAttention, les tailles couvrent plusieurs pointures : 23/26, 27/30, 31/34, 35/38 et 39/41.</p>\r\n<p>\r\n\tMoon Boots pour enfants. Faire un bonhomme de neige, descendre une piste de luge... voilà des activités dont raffolent les enfants ! Mais attention aux petons ! Pour ne pas attraper froid et rester bien au sec, pensez à les chausser d'après-ski ! Et quoi de mieux que les célèbres Moon Boots ! Disponibles en de nombreux coloris, il y a en pour tous les goûts !</p>\r\n", :created_at => "2011-06-14 21:58:43", :updated_at => "2011-06-14 21:58:43" },
  { :id => 99, :sku => "34238", :title => "4007", :description => "<p>\r\n\tBallerines en cuir Ninette en fleur pour fille. Première cuir, intérieur doublé cuir. Voilà des chaussures dont les fillettes vont raffoler ! Ninette sait ce qui plait : un joli cuir argenté, et une multitude de petits clous sur le bout de la chaussure. Des chaussures vraiment parfaites pour jouer les mini miss cet été ! Le contour est élastique pour un bon maintien du pied. L'arrière est légèrement relevé pour éviter les frottements désagréables. Souples et confortables, ces chaussures accompagneront votre princesse tout l'été !</p>\r\n", :created_at => "2011-06-14 22:02:37", :updated_at => "2011-06-14 22:02:37" },
  { :id => 100, :sku => "33876", :title => "HERO", :description => "<p>\r\n\tNu-pieds en cuir &quot;HERO&quot; de Noël pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour plus de confort. Super originaux, ces nu-pieds seront vraiment parfaits pour les beaux jours. Tout a été travaillé par Noël, jusqu'aux semelles intérieure et extérieure personnalisées. Confortables pour les petits pieds fragiles de votre bonhomme, elles sont également très pratiques : trois brides Velcro, dont une à l'arrière, permettent un réglage optimal de la chaussure et un bon maintien du pied. Avec le &quot;1&quot; et l'écusson sur le côté, votre petit prince va vraiment les adorer !</p>\r\n", :created_at => "2011-06-14 22:07:27", :updated_at => "2011-06-14 22:07:27" },
  { :id => 101, :sku => "34223", :title => "DALI KID CVS", :description => "<p>\r\n\tChaussures basses “DALI KID CVS” de Palladium pour garçon.<br />\r\n\tPremière cuir.<br />\r\n\tPalladium propose pour l’été une petite chaussure basse en toile totalement tendance. La marque a mélangé les matières en ajoutant un cuir velours en bout de chaussure. Les couleurs légèrement délavées donnent beaucoup de style à cette chaussure. Les lacets permettent un bon réglage. Un modèle doucement rétro qui va faire fureur !</p>\r\n", :created_at => "2011-06-14 22:11:08", :updated_at => "2011-06-14 22:11:08" },
  { :id => 102, :sku => "34352", :title => "BISTROT", :description => "<p>\r\n\tChaussures basses en cuir &quot;BISTROT&quot; de Pataugas pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir, bout de la chaussure renforcé.<br />\r\n\tBottines en cuir &quot;BUFFY&quot; de Pataugas pour fille.<br />\r\n\tPremière cuir, intérieur doublé cuir, bout de la chaussure renforcé.<br />\r\n\tMarque qui n'est plus à présenter, Pataugas revient cet été avec de jolis modèles pour les garçons. Compromis idéal entre chaussure basse et basket, ces chaussures signées Pataugas arborent un look tendance et discret. Trois brides Velcro, de tailles différentes pour le style, permettent de régler correctement la chaussure et de l'enfiler rapidement. Un plus pour ces jeunes garçons qui n'ont pas de temps à perdre ! Un modèle à la fois tendance et indémodable, parfait pour cet été !</p>\r\n", :created_at => "2011-06-14 22:14:32", :updated_at => "2011-06-22 10:48:48" },
  { :id => 103, :sku => "34633", :title => "TRUANI", :description => "<p>\r\n\tChaussures basses en cuir “TRUANI” de Redskins pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort. Le voilà devenu grand, et il lui faut des chaussures à la hauteur de ses attentes ! Pas tout à fait un ado, c’est pourtant déjà le look qui prime. Redskins propose ici une basket streetwear élégante. Le cuir et la toile se mêle pour un style estival réussi. Redskins a pensé à l’originalité en ajoutant une large des pièces de cuir grahiques blanches et bleues sur le côté. Confortables et “in”, ces chaussures sauront le séduire !</p>\r\n", :created_at => "2011-06-14 22:17:34", :updated_at => "2011-06-14 22:17:34" },
  { :id => 104, :sku => "34023", :title => "HINDI", :description => "<p>\r\n\tBallerines en cuir &quot;HINDI&quot; de Reqins pour fille. Première cuir. Voilà une chaussure parfaite pour votre petite squaw ! En cuir velours, ces ballerines sont très réussies. Le bout de la chaussure est habillé de franges de cuir et d'un lacet noué. Le contour est élastique pour un maintien optimal du pied. Le cuir souple sera en plus très confortable. Le bout de la chaussure est également agrémenté d'une pièce de cuir surpiquée. Totalement tendances, votre grande fille va les adorer !</p>\r\n", :created_at => "2011-06-14 22:22:06", :updated_at => "2011-06-14 22:22:06" },
  { :id => 105, :sku => "35147", :title => "SAHARA", :description => "<p>\r\n\tNu-pieds en cuir &quot;SAHARA&quot; de Reqins pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir.<br />\r\n\tReqins pense avant tout au bien-être et au confort des enfants : la semelle anatomique se lie à une chaussure qui maintient parfaitement le pied. En effet, grâce à ses trois brides, le nu-pieds se règle facilement et le pied est bien maintenu. L'épaisse semelle permet d'amortir les chocs des courses effrénées ! Parfaits pour l'été, ces nu-pieds sont tout ce qu'il faut à votre jeune garçon !</p>\r\n", :created_at => "2011-06-14 22:26:00", :updated_at => "2011-06-14 22:26:00" },
  { :id => 106, :sku => "33134", :title => "CLASSIC BOOTIE", :description => "<p>\r\n\tChaussons &quot;CLASSIC BOOTIE&quot; de Robeez pour bébé.</p>\r\n<p>\r\n\tLa pointure 17 correspond à du 0-6 mois. La pointure 19 correspond à du 6-12 mois. La pointure 21 correspond à du 12-18 mois.</p>\r\n<p>\r\n\tVos petits bouts seront à croquer avec ces chaussons aux pieds ! En cuir et en fourrure, ils protégeront parfaitement les pieds des petits bouts. Le chausson est très légèrement élastique au niveau de la cheville : le pied est ainsi bien maintenu sans être trop serré. Très souple, il ne gênera en rien la bonne croissance du pied. Et en plus, la fourrure est tendance cet hiver ! Hauts comme trois pommes et déjà à la mode !</p>\r\n", :created_at => "2011-06-14 22:30:08", :updated_at => "2011-06-14 22:30:08" },
  { :id => 107, :sku => "34192", :title => "5112", :description => "<p>\r\n\tBottines en cuir Romagnoli pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, bout de la chaussure renforcé.<br />\r\n\tComme toujours, Romagnoli nous propose des modèles tendances et plein de charme pour l'été. C'est ici avec une bottine aux airs doucement sportif que Romagnoli va séduire les bonhommes. Les détails ne manquent pas, à commencer par une bande plastifiée et une étoile sur le talon. Deux bandes Velcro permettent un bon réglage de la chaussure. En bleu flashy ou en gris, il ne vous reste plus qu'à choisir !</p>\r\n<p>\r\n\tSi votre enfant a les pieds larges, nous vous conseillons de prendre une pointure au-dessus de sa pointure habituelle.</p>\r\n", :created_at => "2011-06-14 22:35:28", :updated_at => "2011-06-22 10:48:48" },
  { :id => 108, :sku => "33257", :title => "MYSTIE", :description => "<p>\r\n\tPantoufles &quot;MYSTIE&quot; de Rondinaud pour enfant. En laine et en feutre, ces pantoufles seront particulièrement confortables et chaudes pour les pieds de votre petite puce. Spécialiste de la pantoufle depuis de nombreuses années, Rondinaud a repris le concept de la charentaise pour ses pantoufles. Pour les bouts de chou, il les agrémente de mille et une façons. Ici c'est un bel écossais qui vient agrémenter la pantoufle. Reprenant un esprit totalement rétro, Rondinaud remet au goût du jour une pantoufle bien connue de nos grands-parents. Très chaude et douillette, cette pantoufle plaira à tous les enfants qui aiment se faire dorloter. Dommage que Rondinaud ne propose pas les mêmes pour les grands !</p>\r\n", :created_at => "2011-06-14 22:38:34", :updated_at => "2011-06-14 22:38:34" },
  { :id => 109, :sku => "33974", :title => "8911", :description => "<p>\r\n\tBottines en cuir Rondinella pour garçon. Première cuir, intérieur doublé cuir, bout de la chaussure renforcé, col matelassé pour un confort optimal. Ne sont-elles pas à croquer ? Parce que la mode compte chez les plus jeunes aussi, Rondinella propose une petite bottine dans un cuir gris vieilli s'inspirant du style sneakers. La semelle et les lacets ont également été vieillis pour un effet &quot;used&quot; totalement tendance. Ils permettent de bien régler la bottine, un zip intérieur a cependant été prévu pour plus de praticité. Les détails qui font toute la différence ? Le col vichy, l'étoile en écusson, et les pièces de cuir rouge et bleu ! Avec ça, aucun doute que votre fiston va faire des ravages !</p>\r\n", :created_at => "2011-06-14 22:43:46", :updated_at => "2011-06-14 22:43:46" },
  { :id => 110, :sku => "33112", :title => "JOHN", :description => "<p>\r\n\tChaussures basses à lacets et en cuir &quot;JOHN&quot; de Start Rite pour garçon. Première cuir, intérieur doublé cuir. Le petit prince est de sortie ! Élégante, classe, chic, il n'y a pas assez de mots pour décrire cette chaussure anglaise de la marque Start Rite. Depuis longtemps déjà elle chausse les petits de la famille royale, et ce n'est pas pour rien ! Cuir lisse, style derby, coloris sobres... Avec cette chaussure, vous trouverez non seulement de la qualité, mais également un grand confort !</p>\r\n", :created_at => "2011-06-16 18:58:41", :updated_at => "2011-06-16 18:58:41" },
  { :id => 111, :sku => "33114", :title => "FRANCESA", :description => "<p>\r\n\tChaussures basses en cuir &quot;FRANCESA&quot; de Start Rite pour fille. Première cuir, intérieur doublé cuir. Start Rite propose ici une petite ballerine qui fera rêver toutes les danseuses étoile. A bout rond, elle est agrémentée d'une ganse ton sur ton et d'un joli petit nœud, pour un esprit ballerine très classique. La marque anglaise chausse depuis longtemps la famille anglaise, et ce n'est pas pour rien : qualité et confort sont au rendez-vous. Vous aussi choisissez Start Rite pour votre princesse !</p>\r\n", :created_at => "2011-06-16 19:03:12", :updated_at => "2011-06-16 19:03:12" },
  { :id => 112, :sku => "34259", :title => "TALIM", :description => "<p>\r\n\tBottines en cuir &quot;TALIM&quot; de Stones and Bones pour fille.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chaussure renforcé.<br />\r\n\tLa célèbre marque au petit os revient cet été avec un modèle tendance qui va faire craquer toutes les jeunes filles. Un côté sport mêlé à des couleurs vives et &quot;girly&quot; : voilà comment rendre ces chaussures à la pointe de la mode. Les cuir ont été très travaillés. Les lacets en cuir passent des des anneaux de métal pour un look différent. Un zip intérieur a cependant été prévu pour plus de praticité. Bien entendu, l'intérieur est à l'image de la marque : plein de petits os ! Et en prime, Stones and Bones vous offre un t-shirt !</p>\r\n", :created_at => "2011-06-16 19:08:25", :updated_at => "2011-06-16 19:08:25" },
  { :id => 113, :sku => "34251", :title => "PAVEL", :description => "<p>\r\n\tChaussures en cuir &quot;PAVEL&quot; de Stones and Bones pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chaussure renforcé. Les jeunes garçons vont adorer cette petite chaussure basse. Avec son look sportif et ses couleurs douces, elle sera parfaite pour l'été. Les pièces de cuir ont été particulièrement travaillées : perforées sur la languette, arrondies sur le côté et en bandes surpiquées latérales. Deux bandes Velcro permettent un réglage optimal de la chaussure. Au final, Stones and Bones propose une chaussure presque comme celle des grands !</p>\r\n", :created_at => "2011-06-16 19:12:00", :updated_at => "2011-06-16 19:12:00" },
  { :id => 114, :sku => "35152", :title => "SOO4 AY0", :description => "<p>\r\n\tTennis en toile Superga pour enfants.<br />\r\n\tLa marque italienne Superga revient avec sa célèbre basket pour l'été. Pour changer, elle l'agrémente de Velcro, bien plus pratique pour les enfants ! Vous retrouvez la fameuse semelle blanche avec sa petite ligne de couleur et le look simple et sportif de la tennis rétro. Un modèle confortable pour les enfants, disponibles en plusieurs couleurs !</p>\r\n", :created_at => "2011-06-16 19:15:51", :updated_at => "2011-06-16 19:15:51" },
  { :id => 115, :sku => "34241", :title => "Y00253", :description => "<p>\r\n\tChaussures basses en cuir Tel Yoh pour garçon.<br />\r\n\tPremière cuir, intérieur doublé cuir, col matelassé pour plus de confort, bout de la chaussure renforcé.<br />\r\n\tParticulièrement originale, la marque Tel Yoh propose toujours des modèles aux lignes avant-gardistes. Cette chaussure basse au léger air sportif s'habille d'un cuir vieilli aux dégradés de gris. Les lignes des pièces de cuir ainsi que les surpiqûres renforcent le temps futuriste de la chaussure. Les bandes Velcro, entre cuir et toile, permettent de bien régler la chaussure. En plus, elles permettent de l'enfiler rapidement. Votre bonhomme va adorer ces chaussures au style différent !</p>\r\n", :created_at => "2011-06-16 19:19:47", :updated_at => "2012-10-30 17:21:56" },
  { :id => 116, :sku => "32326", :title => "CROWN POINT OXFORD", :description => "<p>\r\n\tChaussures basses en cuir &quot;CROWN POINT BOYS&quot; de Timberland pour garçon. Première cuir, intérieur doublé cuir, col matelassé pour un meilleur confort, bout de la chaussure renforcé. Timberland, reconnue pour ses chaussures optimisées pour des conditions extrêmes, met son savoir-faire à disposition des plus jeunes. Cette chaussure à l'allure &quot;tout-terrain&quot; a été volontairement vieillie pour donner un vrai look de baroudeur. Pour tous les aventuriers en herbe, elle sera idéale en protégeant parfaitement le pied. Jouant sur différents coloris et différentes pièces de cuir, Timberland pense aussi à la praticité : des bandes Velcro ont été prévues. Au final, chaque Indiana Jones en sommeil sera enchanté par cette paire de chaussures bien robustes et confortables pour grimper sans s'arrêter !</p>\r\n", :created_at => "2011-06-16 19:24:05", :updated_at => "2011-06-16 19:24:05" },
  { :id => 117, :sku => "33121", :title => "JUGGY", :description => "<p>\r\n\tChaussons &quot;JUGGY&quot; de Tip Toey Joey pour bébé.<br />\r\n\tLa pointure 19 correspond à du 6-9 mois.<br />\r\n\tLa pointure 20 correspond à du 9-12 mois.<br />\r\n\tLa pointure 21 correspond à du 12-15 mois.<br />\r\n\tLa pointure 22 correspond à du 15-18 mois.<br />\r\n\tLa pointure 23 correspond à du 18-21 mois.<br />\r\n\tPremière cuir, intérieur doublé cuir, semelle souple et fine.<br />\r\n\tOn veut les mêmes ! Douillets comme il faut, ces chaussons garderont le pied de Bébé bien au chaud. Avec leur col de laine, ils seront très confortables pour ses petits pieds. Un léger élastique arrière permettra de maintenir le chausson bien en place. Et aucune inquiétude, ce chausson respecte parfaitement la croissance du pied !</p>\r\n", :created_at => "2011-06-16 19:28:31", :updated_at => "2011-06-16 19:28:31" },
  { :id => 118, :sku => "34081", :title => "BAXTER", :description => "<p>\r\n\tBaskets en cuir &quot;WIDOW&quot; de Vans pour garçon. Première cuir, col matelassé pour un meilleur confort. Il n'y a pas d'âge pour être tendance ! Vous le savez, chez les jeunes le look est très important. Offrez leur des Vans ! Parfaites pour les skaters ou ceux qui arborent un look streetwear, ces baskets feront l'unanimité. Aussi confortables que des pantoufles, vous ne regretterez pas de leur avoir fait plaisir avec ces chaussures très &quot;mode&quot; !</p>\r\n", :created_at => "2011-06-16 19:32:58", :updated_at => "2011-06-16 19:32:58" }
], :without_protection => true )



